import "../meio/meio.css";
import Janela from "./janela/janela";

function Meio({ buscarJson, conteudoJson }) {
  return (
    <div className="meio">
      <Janela buscarJson={buscarJson} conteudoJson={conteudoJson} />
    </div>
  );
}

export default Meio;
